        super();
        this.state = {
            test: "testing"
        };
    }

    handleBarClick = () => {
        axios.get("/routes/buyer").then(response =>{
            this.setState({
                test: response.data
            });
            console.log(response)
        });        
    };

        render(){
        return (
          <div className="modprofbar">
              <form>
